{"code": "impl<F, H> TextBrush<F, H>
where
    F: Font + Sync,
    H: std::hash::BuildHasher,
{
    pub fn queue<'a, S, I>(&mut self, device: &wgpu::Device, queue: &wgpu::Queue, sections: I) -> Result<(), BrushError>
    where
        S: Into<std::borrow::Cow<'a, Section<'a>>>,
        I: IntoIterator<Item = S>,
    {
        for s in sections {
            self.inner.queue(s);
        }
        loop {
            let brush_action = self.inner.process_queued(
                |rect, data| self.pipeline.update_texture(rect, data, queue),
                Vertex::to_vertex,
            );
            match brush_action {
                Ok(action) => {
                    match action {
                        BrushAction::Draw(vertices) => {
                            self.pipeline.update_vertex_buffer(vertices, device, queue);
                        }
                        BrushAction::ReDraw => {}
                    }
                    break;
                }
                Err(glyph_brush::BrushError::TextureTooSmall { suggested }) => {
                    let max_dim = device.limits().max_texture_dimension_2d;
                    let (width, height) = if suggested.0 > max_dim || suggested.1 > max_dim {
                        (max_dim, max_dim)
                    } else {
                        suggested
                    };
                    self.pipeline.resize_texture(device, (width, height));
                    self.inner.resize_texture(width, height);
                }
            }
        }
        Ok(())
    }
}", "code_context": "use glyph_brush::{self, BrushAction, Section, GlyphBrushBuilder, GlyphBrush, Extra, Font};
use wgpu::{self, Device, Queue};

pub struct TextBrush<F = FontArc, H = DefaultSectionHasher> {
    inner: GlyphBrush<Vertex, Extra, F, H>,
    pipeline: Pipeline,
}

pub struct Pipeline;
impl Pipeline {
    pub fn update_texture(&self, _rect: glyph_brush::Rectangle<u32>, _data: &[u8], _queue: &wgpu::Queue) {}
    pub fn update_vertex_buffer(&self, _vertices: Vec<Vertex>, _device: &wgpu::Device, _queue: &wgpu::Queue) {}
    pub fn resize_texture(&mut self, _device: &wgpu::Device, _size: (u32, u32)) {}
}

#[repr(C)]
#[derive(Copy, Clone, bytemuck::Pod, bytemuck::Zeroable)]
pub struct Vertex;
impl Vertex {
    pub fn to_vertex(_gv: glyph_brush::GlyphVertex) -> Vertex { Vertex }
}

pub type FontArc = glyph_brush::ab_glyph::FontArc;
pub type DefaultSectionHasher = std::collections::hash_map::DefaultHasher;

pub enum BrushError {
    TooBigCacheTexture(u32),
}
"}

